        "# Importing Dependencies\n",
        "import numpy as np\n",
        "import pandas as pd\n",
        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "from sklearn.model_selection import train_test_split\n",
        "from sklearn.linear_model import LogisticRegression\n",
        "from sklearn.metrics import accuracy_score, confusion_matrix, classification_report\n",
        "\n",
        "# Data Collection & Processing\n",
        "titanic_data = pd.read_csv('https://raw.githubusercontent.com/datasciencedojo/datasets/master/titanic.csv')\n",
        "\n",
        "# Basic Information\n",
        "print(titanic_data.head())\n",
        "print(\"Shape:\", titanic_data.shape)\n",
        "print(titanic_data.info())\n",
        "print(\"Missing values:\\n\", titanic_data.isnull().sum())\n",
        "\n",
        "# Handling Missing Values\n",
        "titanic_data.drop(columns='Cabin', axis=1, inplace=True)\n",
        "titanic_data['Age'].fillna(titanic_data['Age'].mean(), inplace=True)\n",
        "titanic_data['Fare'].fillna(titanic_data['Fare'].mode()[0], inplace=True)\n",
        "titanic_data['Embarked'].fillna(titanic_data['Embarked'].mode()[0], inplace=True)\n",
        "\n",
        "# Check missing values again\n",
        "print(\"Missing values after handling:\\n\", titanic_data.isnull().sum())\n",
        "\n",
        "# Data Analysis\n",
        "print(titanic_data.describe())\n",
        "print(\"Survival counts:\\n\", titanic_data['Survived'].value_counts())\n",
        "\n",
        "# Data Visualization\n",
        "sns.set()\n",
        "\n",
        "# Count plots\n",
        "sns.countplot(x=\"Survived\", data=titanic_data)\n",
        "plt.title(\"Survival Count\")\n",
        "plt.show()\n",
        "\n",
        "sns.countplot(x=\"Sex\", hue=\"Survived\", data=titanic_data)\n",
        "plt.title(\"Gender vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "sns.countplot(x=\"Pclass\", hue=\"Survived\", data=titanic_data)\n",
        "plt.title(\"Passenger Class vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "sns.countplot(x=\"Embarked\", hue=\"Survived\", data=titanic_data)\n",
        "plt.title(\"Embarked vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "sns.countplot(x=\"Parch\", hue=\"Survived\", data=titanic_data)\n",
        "plt.title(\"Parch vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "sns.countplot(x=\"SibSp\", hue=\"Survived\", data=titanic_data)\n",
        "plt.title(\"SibSp vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "# Better Age plot for continuous data\n",
        "plt.figure(figsize=(10,6))\n",
        "sns.histplot(titanic_data, x='Age', hue='Survived', bins=30, kde=True)\n",
        "plt.title(\"Age Distribution vs Survival\")\n",
        "plt.show()\n",
        "\n",
        "# Encoding Categorical Columns\n",
        "titanic_data.replace({'Sex': {'male': 0, 'female': 1},\n",
        "                      'Embarked': {'S': 0, 'C': 1, 'Q': 2}}, inplace=True)\n",
        "\n",
        "# Feature & Target Separation\n",
        "X = titanic_data.drop(columns=['PassengerId', 'Name', 'Ticket', 'Survived'], axis=1)\n",
        "Y = titanic_data['Survived']\n",
        "\n",
        "# Splitting the data\n",
        "X_train, X_test, Y_train, Y_test = train_test_split(X, Y, test_size=0.2, random_state=2)\n",
        "print(\"Train shape:\", X_train.shape, \"Test shape:\", X_test.shape)\n",
        "\n",
        "# Logistic Regression\n",
        "model = LogisticRegression(max_iter=200)  # increase max_iter to avoid convergence warnings\n",
        "model.fit(X_train, Y_train)\n",
        "\n",
        "# Model Evaluation\n",
        "# Training accuracy\n",
        "X_train_pred = model.predict(X_train)\n",
        "train_accuracy = accuracy_score(Y_train, X_train_pred)\n",
        "print(\"Training Accuracy:\", train_accuracy)\n",
        "\n",
        "# Testing accuracy\n",
        "X_test_pred = model.predict(X_test)\n",
        "test_accuracy = accuracy_score(Y_test, X_test_pred)\n",
        "print(\"Test Accuracy:\", test_accuracy)\n",
        "\n",
        "# Confusion Matrix & Classification Report\n",
        "print(\"Confusion Matrix:\\n\", confusion_matrix(Y_test, X_test_pred))\n",
        "print(\"\\nClassification Report:\\n\", classification_report(Y_test, X_test_pred))\n"
